INSERT INTO `artisans` VALUES (292,'MOCHIDS', 'STARLIT', 'Mochi Dog Studios', 'Starlit Horizon Studios\nGalaxy Fur Creations', 'Hello! We are SHS, a fursuit studio based out of Mississippi! :D', '2012-09', 'US', 'Mississippi', 'Pheba', 'Artistic liberty commissions\nPremades\nStandard commissions', 'Kemono\nKigurumi\nSemi Realistic\nSemi Toony\nToony', '', 'Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', 'Willing to make anything as I love to experiment!\nProps\nArm sleeves\nWings\nLegs\nPlushies\nArt\nBadges\nFoam Bases\nSockpaws\nBandannas\nCare kits for suits\nDigi-styled hooves\nEyes\nClaws\nFlower crowns\nFursuit Collars\nFursuit sprays\nHarnesses\nBackpacks\nSandals', 'Adjustable eyebrows\nAdjustable/wiggle ears\nAttached handpaws and feetpaws\nAttached tail\nElectronics/animatronics\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nIndoor feet\nLED eyes\nLED/EL lights\nMovable jaw\nOutdoor feet\nRemovable eyelids\nRemovable horns/antlers', 'Ask me about features, I will happily try to accomodate your needs!\nFit for glasses\nPickable nose\nHidden pockets\nDance-specific feetpaws\nEar vents\nSqueaker in nose\nWings\nAccessories (ear plugs, piercings, etc.)\nAirbrushed or sewn-in details\nAirbrushing\nBody padding\nClaw-fingers\nDrybrushing\nExcellent vision & breathability\nHairstyling\nI can also make costume elements for an additional cost\nPosable bendable parts, tongue, ears, hair\nPoseable ears\nPuffy handpaws\nWire (anyplace)\nAccessories/jewelry\nPlush suits\nContact-safe heads for LARP usage\nFloor dragger\nFursuit harnesses\nGlitter materials\nHeavily padded limbs/paws\nHidden pocket\nLED claws\nwhiskers\nNostril holes\nUV reactive features\nStompy paws', 'Any to get into the queue, 50% to get a permanent spot, must make monthly payments of at least $80+. We can also work out custom payment plans, this can be discussed after getting a quote.', 'Any species', 'Robotic stuff', 'English\nKorean (limited)', 'Always open for commissions', 'NO', '', '');
INSERT INTO `artisans` VALUES (293,'HUNNIBR', '', 'Hunni Bear Art', '', 'I am an Australian maker who makes suits with perfect vision and movable jaws. If you want something simple or something out of the ordinary I am always happy to bring it to life.', '2017-06', 'AU', '', '', 'Artistic liberty commissions\nPremades\nStandard commissions', 'Semi Toony\nToony', '', 'Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '', 'Adjustable eyebrows\nAttached handpaws and feetpaws\nAttached tail\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nIndoor feet\nLED eyes\nLED/EL lights\nMovable jaw\nOutdoor feet\nRemovable blush\nRemovable eyelids\nRemovable horns/antlers\nWashable heads', '', 'Material costs as downpayment, labour costs can be paid in full or a payment plan of at least $500 AUD per month until fully paid.', 'All species and all fur based characters.', '', 'English', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: hun******art@gm*****om');
